import React from 'react';

const Welcome = () => {
    return (
        <div>
            <h1>Welcome to the RLAB</h1>
            <h3>Ulises Ramos Lab</h3>
            <p>Lorem ipsum dolor sit amet consectetur adipisicing.</p>
            <div className="welcome-img">
                <img src="../../../Resorces/f2.jpg" alt="" />
            </div>
        </div>
    );
};

export default Welcome;
